// src/plugins/protecting-source/index.tsx
import React, { useState, useEffect, useRef, ChangeEvent } from "react";
import ReactDOM from "react-dom";
import Tooltip from "components/Tooltip";
import ExpansionBox, { ExpansionRect } from "components/ExpansionBox";
import { Button, GandiProvider, Switch, Text, HStack, Input, useMessage } from "@gandi-ide/gandi-ui";
import styles from "./styles.less";
import useStorageInfo from "hooks/useStorageInfo";
import ProtectingSourceIcon from "assets/icon--protecting-source.svg";
const DEFAULT_CONTAINER_INFO = {
  width: 300,
  height: 450,
  translateX: 72,
  translateY: 60,
};

const ProtectingSource: React.FC<PluginContext> = ({ msg, vm, workspace, blockly, utils, registerSettings }) => {
  const [currentIndex, setCurrentIndex] = React.useState(0);
  const [loading, setLoading] = React.useState("load");
  const [visible, setVisible] = useState(false);
  const [showIdeOrigin, setShowIdeOrigin] = useState(true);
  const [ideOrigin, setIdeOrigin] = useState("Gandi");
  const [ideLinkOrigin, setIdeLinkOrigin] = useState("https://getgandi.com/");
  const containerRef = useRef<HTMLDivElement>(null);
  const [containerInfo, setContainerInfo] = useStorageInfo<ExpansionRect>(
    "TOOLBOX_BLOCKS_SEARCH_CONTAINER_INFO",
    DEFAULT_CONTAINER_INFO,
  );
  const [showWhy, setShowWhy] = useState(false);
  const [showHow, setShowHow] = useState(true);
  const containerInfoRef = React.useRef(containerInfo);

  // 感谢 FurryR @ Github 提供的实现逻辑
  const hackPlatformUpdate = () => {
    const _toJSON = vm.toJSON;
    vm.toJSON = function (...args) {
      const result = JSON.parse(_toJSON.apply(this, args));
      result.meta.platform = { name: ideOrigin, url: ideLinkOrigin };
      return JSON.stringify(result);
    };
  };

  const hackPlatformDelete = () => {
    const _toJSON = vm.toJSON;
    vm.toJSON = function (...args) {
      const result = JSON.parse(_toJSON.apply(this, args));
      delete result.meta.platform;
      return JSON.stringify(result);
    };
  };

  const handleClick = React.useCallback((e: React.MouseEvent | undefined) => {
    if (e) e.preventDefault();
    setLoading("load");
    setCurrentIndex(0);
    if (e) {
      const rect = (e.target as HTMLDivElement).getBoundingClientRect();
      setContainerInfo({
        ...containerInfoRef.current,
        translateX: rect.x + 28,
        translateY: rect.y - 6,
      });
    } else {
      setContainerInfo({
        ...containerInfoRef.current,
      });
    }
    setVisible(true);
  }, []);

  const handleClose = () => {
    setVisible(false);
  };

  const handleSizeChange = (rect: ExpansionRect) => {
    // setContainerInfo(rect);
    return;
  };

  const handleSwitchChange = (event: ChangeEvent<HTMLInputElement>) => {
    setShowIdeOrigin(event.target.checked);
    if (!event.target.checked) {
      hackPlatformDelete();
    }
  };

  useEffect(() => {
    if (containerRef.current) {
      const rect = containerRef.current.getBoundingClientRect();
      handleSizeChange({
        width: rect.width,
        height: rect.height,
        translateX: rect.left,
        translateY: rect.top,
      });
    }
  }, [visible, containerRef]);

  const register = registerSettings(
    // 这是插件的名称，这里需要支持国际化
    msg("plugins.protectingSource.name"),
    // 插件的ID，要求命名用 plugin-aaa-bbb 的形式
    "plugin-protecting-source",
    [
      {
        // 这是每一组配置的key
        key: "how",
        // 这是这一组Key的名称
        label: msg("plugins.protectingSource.doc.title"),
        description: (
          <>
            {msg("plugins.protectingSource.doc.1")}
            <p style={{ color: "#EE6A5F" }}>{msg("plugins.protectingSource.doc.2")}</p>
            <hr className={styles.docHr} />
            <h3 className={styles.docTitle}>{msg("plugins.protectingSource.doc.3")}</h3>
            {msg("plugins.protectingSource.doc.4")}
            <br />
            {msg("plugins.protectingSource.doc.5")}
            <br />
            <img src="data:image/png;base64," />
            <br />
            {msg("plugins.protectingSource.doc.6")}
            <br />
            <h3 className={styles.docTitle}>{msg("plugins.protectingSource.doc.7")}</h3>
            {msg("plugins.protectingSource.doc.8")}
            <br />
            {msg("plugins.protectingSource.doc.9")}
            <img
              src={
                "data:image/jpeg;base64,"
              }
            />
            {msg("plugins.protectingSource.doc.10")}
            <img
              src={
                "data:image/png;base64,"
              }
            />
            {msg("plugins.protectingSource.doc.11")}
            <img
              src={
                "data:image/png;base64,"
              }
            />
          </>
        ),
        items: [
          {
            key: "why",
            type: "switch",
            label: msg("plugins.protectingSource.doc.12"),
            value: false,
            description: msg("plugins.protectingSource.doc.13"),
          },
        ],
      },
    ],
    // 这个是插件的一个icon，可以是一个 React 组件，或者一个 img 的地址
    <ProtectingSourceIcon />,
  );

  return ReactDOM.createPortal(
    <GandiProvider>
      <Tooltip
        className={styles.icon}
        icon={<ProtectingSourceIcon />}
        onClick={handleClick}
        tipText={msg("plugins.protectingSource.name")}
      />
      {visible &&
        ReactDOM.createPortal(
          <div className={styles.container}>
            <ExpansionBox
              id="protectingSource"
              title={msg("plugins.protectingSource.name")}
              containerInfo={containerInfo}
              onClose={handleClose}
              onSizeChange={handleSizeChange} // 空函数
              minWidth={300}
              minHeight={450}
              borderRadius={8}
            >
              <div className={styles.toolboxItem}>
                <HStack spacing="24px">
                  <p className={styles.toolboxText}>{msg("plugins.protectingSource.openShow")}</p>
                  <Switch size="md" defaultChecked onChange={handleSwitchChange} />
                </HStack>
              </div>
              {showIdeOrigin && (
                <div>
                  <HStack spacing="24px" className={styles.toolboxItem}>
                    <p className={styles.toolboxText}>{msg("plugins.protectingSource.ideNameInput")}</p>
                    <Input
                      placeholder={msg("plugins.protectingSource.ideNameInput")}
                      value={ideOrigin}
                      onChange={(e) => {
                        setIdeOrigin(e.target.value);
                        hackPlatformUpdate();
                      }}
                    />
                  </HStack>
                  <HStack spacing="24px" className={styles.toolboxItem}>
                    <p className={styles.toolboxText}>{msg("plugins.protectingSource.ideLink")}</p>
                    <Input
                      placeholder={msg("plugins.protectingSource.ideLinkInput")}
                      value={ideLinkOrigin}
                      onChange={(e) => {
                        setIdeLinkOrigin(e.target.value);
                        hackPlatformUpdate();
                      }}
                    />
                  </HStack>
                  <HStack spacing="12px" className={styles.toolboxItem}>
                    <p className={styles.tipP}>{msg("plugins.protectingSource.tip")}</p>
                  </HStack>
                </div>
              )}
            </ExpansionBox>
          </div>,
          document.body,
        )}
    </GandiProvider>,
    document.querySelector(".plugins-wrapper"),
  );
};

ProtectingSource.displayName = "ProtectingSource";

export default ProtectingSource;
